import React from 'react';
import { __ } from '@wordpress/i18n';
import { useSelector, useDispatch } from 'react-redux';

import getApiData from '@Controls/getApiData';
import { Container, Label, Badge } from '@bsf/force-ui';
import UpgradeNotices from '@DashboardApp/pages/settings/UpgradeToPro';

const propTypes = {};

const defaultProps = {};

export default function DynamicContent() {
	const dispatch = useDispatch();
	const dynamicContentMode = useSelector( ( state ) => state.dynamicContentMode );

	const dynamicContentHandler = ( value ) => {
		dispatch( { type: 'UPDATE_DYNAMIC_CONTENT_MODE', payload: value } );
		// Create an object with the security and value properties
		const data = {
			security: uag_react.dynamic_content_mode_nonce,
			value,
		};
		// Call the getApiData function with the specified parameters
		const getApiFetchData = getApiData( {
			url: uag_react.ajax_url,
			action: 'uag_dynamic_content_mode',
			data,
		} );
		// Wait for the API call to complete, then update the state to show a notification that the settings have been saved
		getApiFetchData.then( () => {
			dispatch( {
				type: 'UPDATE_SETTINGS_SAVED_NOTIFICATION',
				payload: __( 'Successfully saved!', 'ultimate-addons-for-gutenberg' ),
			} );
		} );
	};

	const dynamicModalData = {
		title: __( 'Unlock Dynamic Content', 'ultimate-addons-for-gutenberg' ),
		Image: DynamicImage,
		header: __( 'Dynamic Content, Tailored for Every Visitor', 'ultimate-addons-for-gutenberg' ),
		description: __(
			'Tailored content for individual users based on their preferences and behavior anywhere on your website.',
			'ultimate-addons-for-gutenberg'
		),
		features: [
			__( 'Text and images anywhere from any source', 'ultimate-addons-for-gutenberg' ),
			__( 'Update once to reflect changes everywhere', 'ultimate-addons-for-gutenberg' ),
			__( 'Dynamic content fallback', 'ultimate-addons-for-gutenberg' ),
		],
	};

	return (
		<>
			{ uag_react.pro_plugin_status !== 'Activated' ? (
				<UpgradeNotices
					title={
						<div className="flex gap-2 items-center">
							{ __( 'Dynamic Content', 'ultimate-addons-for-gutenberg' ) }
							<Badge
								label={ __( 'PRO', 'ultimate-addons-for-gutenberg' ) }
								size="xxs"
								type="pill"
								variant="inverse"
							/>
						</div>
					}
					description={ __(
						'Choose how you want to display dynamic content settings',
						'ultimate-addons-for-gutenberg'
					) }
					upgradeText={ __(
						'delivers relevant content for higher engagement.',
						'ultimate-addons-for-gutenberg'
					) }
					upgradeBold={ __( 'Personalized content', 'ultimate-addons-for-gutenberg' ) }
					modalData={ dynamicModalData }
					dynamicContent={ true }
				/>
			) : (
				<>
					<SettingsItem
						title={ __( 'Dynamic Content', 'ultimate-addons-for-gutenberg' ) }
						settingText={ __(
							"This setting will apply to Container Block's default Content Width.",
							'ultimate-addons-for-gutenberg'
						) }
					>
						<div
							className="flex justify-center items-center rounded-sm overflow-hidden"
							style={ { border: '1px solid #e5e7eb', borderRadius: '0.25rem' } }
						>
							<div
								onClick={ () => dynamicContentHandler( 'popup' ) }
								className={ `${
									dynamicContentMode === 'popup'
										? 'text-text-inverse bg-background-brand'
										: 'text-text-secondary'
								} p-2 cursor-pointer` }
								style={ { border: 'none', borderRight: '1px solid #e5e7eb' } }
							>
								Popup
							</div>
							<div
								onClick={ () => dynamicContentHandler( 'sidebar' ) }
								className={ `${
									dynamicContentMode === 'popup'
										? 'text-text-secondary'
										: 'text-text-inverse bg-background-brand'
								} p-2 cursor-pointer` }
								style={ { border: 'none' } }
							>
								Sidebar
							</div>
						</div>
					</SettingsItem>
					<hr className="w-full border-b-0 border-x-0 border-t border-solid border-t-border-subtle" />
				</>
			) }
		</>
	);
}

const SettingsItem = ( { title, settingText, children } ) => {
	return (
		<Container
			align="center"
			className="mb-0.5 w-full flex lg:items-center items-start justify-between lg:flex-row flex-col"
		>
			<Container.Item className="space-y-1 lg:max-w-[480px]">
				<Label className="font-semibold mb-1" htmlFor="default-width" size="md">
					{ title }
				</Label>
				<Label className="m-0 font-normal" size="sm" tag="p" variant="help">
					{ settingText }
				</Label>
			</Container.Item>

			{ children }
		</Container>
	);
};

const DynamicImage = () => (
	<svg
		width="360"
		height="208"
		viewBox="0 0 360 208"
		fill="none"
		xmlns="http://www.w3.org/2000/svg"
		// xmlns:xlink="http://www.w3.org/1999/xlink"
	>
		<rect y="10" width="296" height="188" fill="url(#pattern0_9521_94902)" />
		<path
			d="M275 70C275 67.7909 276.791 66 279 66H356C358.209 66 360 67.7909 360 70V174C360 176.209 358.209 178 356 178H279C276.791 178 275 176.209 275 174V70Z"
			fill="url(#pattern1_9521_94902)"
		/>
		<defs>
			<pattern id="pattern0_9521_94902" patternContentUnits="objectBoundingBox" width="1" height="1">
				<use xlinkHref="#image0_9521_94902" transform="matrix(0.000913864 0 0 0.00143885 0.00194439 0)" />
			</pattern>
			<pattern id="pattern1_9521_94902" patternContentUnits="objectBoundingBox" width="1" height="1">
				<use xlinkHref="#image1_9521_94902" transform="matrix(0.003125 0 0 0.00237165 0 -0.0691964)" />
			</pattern>
			<image
				id="image0_9521_94902"
				width="1090"
				height="695"
				xlinkHref="data:image/png;base64,"
			/>
			<image
				id="image1_9521_94902"
				width="320"
				height="480"
				xlinkHref="data:image/jpeg;base64,"
			/>
		</defs>
	</svg>
);

DynamicContent.propTypes = propTypes;
DynamicContent.defaultProps = defaultProps;
